import "../styles/dashboard.css";

const DashboardPage = () => {
    return (
        <div className="dashboard">
            <div className="contents">
                <div className="first">
                    <img src="/images/Untitled design (1).jpg" alt="" />
                    <h3>Choose a file or drag it here</h3>
                </div>
                <div className="arrow">
                    <img src="/images/back-arrow-icon.png" alt="" />
                </div>
                <div className="second">
                    <h3>PDF File</h3>
                    <img src="/images/pngkey.com-pdf-icon-png-6540916.png" alt="" />
                    <h4>Drag and drop the file to the left to experience OriginStamp</h4>
                </div>
            </div>
        </div>
    );
};

export default DashboardPage;
